import React, { useState, useEffect } from "react";

function CharacterPage() {
  useEffect(() => {
    fetch("http://localhost:3000/characters?_limit=10")
      .then((r) => r.json())
      .then((data) => console.log(data));
  }, []);
  return (
    <div>
      <h1>Characters</h1>
    </div>
  );
}
export default CharacterPage;
